import React from 'react';
import '../../css/Home.css';
import { withTranslation } from 'react-i18next';

class Home extends React.Component {
    render() {
        return (
            <div className="home-container">
                <div className="jumbotron jumbotron-fluid home-background">
                    <div className="container">
                        <h1 className="display-4 font-color-jumbotron">Let's dive!</h1>
                    </div>
                    <div className="home-grid">
                        <div className="home-grid-item">
                        <h1 className="display-3 font-color-jumbotron">Built for divers</h1>
                        <p className="lead font-color-jumbotron">Step into the depths of the ocean.</p>
                        </div>
                        <div className="home-grid-item"></div>
                        <div className="home-grid-item">
                            <div className="btn-container">
                                <button type="button" class="btn btn-lg btn-fb" style={{color: 'white'}}>
                                    <i class="fab fa-facebook-f pr-1"></i> 
                                    {this.props.t("login.facebook-btn")}
                                </button>
                            </div>
                       </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default withTranslation('common')(Home);
